import React from "react";
import home from "./Home.module.css"

const Home = () => {
    let itemName = <a className={home.item}>Viktor</a>
    return (
        <div className={home.home}>
            <ul className={home.list}>
                {itemName}
            </ul>
        </div>
    )
}

export default Home
